/*------------------------------------------------
CREATE DATABASE
-------------------------------------------------*/
create database awesome_chocolates;


/*------------------------------------------------
CREATE TABLE
-------------------------------------------------*/
create table Geo(
    GeoID serial not null primary key,
    City varchar(250) not null,
    State varchar(250) not null,
    Created timestamp default now()
);




create table SalesPerson(
SalesPersonId serial not null primary key,
first_name varchar(250) not null,
last_name varchar(250) not null,
team varchar(250) not null,
GeoID int not null,
Created timestamp default now(),
constraint fl_salesperson_geo foreign key (GeoID) references Geo(GeoID)
);




create table products(
productid serial not null primary key,
name varchar(250) not null,
quantity numeric not null,
cost_per_unit numeric(15,6) not null,
discount numeric(15,6) not null,
created timestamp default now()
);



create table customers(
customerid serial not null primary key,
first_name varchar(250) not null,
last_name varchar(250) not null,
phone_number varchar(50) not null,
email varchar(350) not null,
address varchar(500) not null,
GeoID int not null,
Created timestamp default now(),
constraint fl_customers_geo foreign key (GeoID) references Geo(GeoID)
);



create table sales(
salesid serial not null primary key,
salespersonid int not null,
customerid int not null,
productid int not null,
quantity int not null,
amount numeric(15,6) not null,
discount numeric(15,6) not null,
total numeric(15,6) not null,
geoid int not null,
salesdate timestamp not null,
Created timestamp default now(),
constraint fl_sales_salesperson foreign key (salespersonid) references salesperson (salespersonid),
constraint fl_sales_customers foreign key (customerid) references customers (customerid),
constraint fl_sales_products foreign key (productid) references products (productid),
constraint fl_sales_geo foreign key (GeoID) references Geo(GeoID)
);



